-- CAL HOUSING DATA SET

CREATE TABLE cal_housing_ex_raw(
      id INTEGER,
      MedInc FLOAT,
      HouseAge FLOAT,
      AveRooms FLOAT,
      AveBedrms FLOAT,
      Population FLOAT,
      AveOccup FLOAT,
      Latitude FLOAT,
      Longitude FLOAT,
      MedHouseVal FLOAT,
      pi INTEGER)
PRIMARY INDEX ( id );


