-- Stepwise Regression enhancement for TD_GLM

CREATE TABLE boston_data(
        id      integer,
        CRIM    real,
        ZN      real,
        INDUS   real,
        CHAS    real,
        NOX     real,
        RM      real,
        AGE     real,
        DIS     real,
        RAD     real,
        TAX     real,
        PTRATIO real,
        B       real,
        LSTAT   real,
        price   real)
primary index (id);


-- TD_GLM (Partition By Key)

CREATE TABLE housing_train_segment (
        sn integer,
        price real,
        lotsize real,
        bedrooms  integer,
        bathrms integer,
        stories integer,
        driveway real,
        recroom real,
        fullbase real,
        gashw real,
        airco real,
        garagepl integer,
        prefarea real ,
        homestyle integer,
        partition_id integer)
primary index (partition_id);


CREATE TABLE housing_train_attribute (
    partition_id integer,
    attribute_column VARCHAR(64))
primary index (partition_id);


CREATE TABLE housing_train_parameter (
        partition_id integer,
                parameter_column VARCHAR(64),
                value_column VARCHAR(64))
primary index (partition_id);

